def find_primes(limit):
    min_prime = 2
    primes = []

    if limit < min_prime:
        return primes

    for number in range(min_prime, limit + 1):
        is_prime = True

        if number == 2:
            primes.append(number)
            continue

        for divisor in range(2, int(number ** 0.5) + 1):
            if number % divisor == 0:
                is_prime = False
                break

        if is_prime:
            primes.append(number)

    return primes


