def calculate_fibonacci_number(n):
    first_num = 0
    second_num = 1

    if n <= 0:
        return first_num
    elif n == 1:
        return second_num

    current = 2
    while current <= n:
        next_num = first_num + second_num
        first_num = second_num
        second_num = next_num
        current = current + 1

    return second_num


