def fibonacci(n):
    # Calculate the fibonacci number
    if n < 0:
        return None
    elif n == 0:
        return 0
    elif n == 1:
        return 1
    else:
        prev = 0
        current = 1
        position = 2
        while position <= n:
            next_value = prev + current
            # Update values
            prev = current
            current = next_value
            position = position + 1
        return current

